        0: "Das Gebilde vor euch am Baum ist etwa einen Schritt hoch und \xE4hnelt stark einem kleinen Baum, gar einer Eiche. Die Wurzeln wurden so angefertigt, dass jene den Stamm halten k\xF6nnen. Der Stamm erscheint robust und beeinhaltet viele Einkerbungen, die an eine Rinde erinnern, die Farbe kommt einem dunklen Braunton gleich.\n\
