          Zwei etwas dickere \xC4ste f\xFChren den Stamm nach oben hin weiter und verlaufen in sich selbst. Sie umschlingen sich, da wo sich die Baumkrone befinden sollte und umrahmen einen gl\xE4nzenden Alexandrit, welcher das Licht, das auf ihn f\xE4llt wie ein Prisma bricht und somit die verschiedenen sichtbaren Farben reflektiert und den Altar erstrahlen l\xE4sst."
